DELIMITER $$
--
-- Procedure
--
CREATE DEFINER=`root`@`localhost` PROCEDURE `eventistudiatigruppo` (IN `nogr` VARCHAR(40), IN `cigr` VARCHAR(40))  IF nogr='TUTTI' THEN

SELECT gruppo.nome,gruppo.citta,studia.evento,studia.inizio, studia.fine
FROM studia NATURAL JOIN parte NATURAL JOIN gruppo
GROUP BY studia.evento,parte.idgr;

ELSE

SELECT DISTINCT studia.evento, coinvolto.corpo, studia.inizio,studia.fine
FROM studia JOIN parte ON studia.astrofilo=parte.astrofilo JOIN coinvolto ON studia.idstudio=coinvolto.id JOIN gruppo ON gruppo.idgr=parte.idgr
WHERE gruppo.nome=nogr AND gruppo.citta=cigr;
END IF$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `locrankmin` (IN `minimo` INT)  NO SQL
SELECT nomeloc, provloc,AVG(voto) AS rank
FROM giudica
GROUP BY nomeloc,provloc
HAVING rank>=minimo$$

--
-- Funzioni
--
CREATE DEFINER=`root`@`localhost` FUNCTION `migliorgruppo` () RETURNS VARCHAR(83) CHARSET latin1 BEGIN

    DECLARE x varchar(40);
    DECLARE y varchar(40);
    DECLARE z varchar(83);

    SELECT gruppo INTO x
    FROM gruppistudi
    WHERE numero = (SELECT MAX(numero)
                    FROM gruppistudi)
    LIMIT 1;
    
    SELECT citta INTO y
    FROM gruppistudi
    WHERE numero = (SELECT MAX(numero)
                    FROM gruppistudi)
    LIMIT 1;
    
    SET z=CONCAT(x,' - ', y);
    RETURN z;

END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `numstudiastr` (`usr` VARCHAR(20)) RETURNS INT(4) BEGIN
    DECLARE num int;
    SELECT COUNT(username)
    INTO num
    FROM astrofilo JOIN studia
    ON astrofilo.mail=studia.astrofilo
    WHERE username=usr;
    RETURN num;
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `primostudio` (`ev` VARCHAR(40), `cor` VARCHAR(40)) RETURNS VARCHAR(40) CHARSET latin1 BEGIN
    DECLARE t DATETIME;
    CREATE TEMPORARY TABLE supp(
        corpo varchar(40),
        evento varchar(40),
        inizio datetime
    );
    
    INSERT INTO supp(corpo,evento,inizio)
    SELECT coinvolto.corpo,studia.evento,inizio
    FROM coinvolto JOIN studia ON coinvolto.id=studia.idstudio
    ORDER BY inizio ASC;
 
    SELECT inizio 
    INTO t
    FROM supp
    WHERE evento=ev
    AND corpo=cor
    LIMIT 1;
    RETURN t;
END$$

DELIMITER ;

