--
-- Trigger `corpo`
--
DELIMITER $$
CREATE TRIGGER `eliminaeventodacorpo` BEFORE DELETE ON `corpo` FOR EACH ROW BEGIN
    DECLARE c varchar(40);
    SET c=OLD.nome;

    CREATE TEMPORARY TABLE supp(
        ID INT
    );

    INSERT supp(ID)
    SELECT id 
    FROM coinvolto
    WHERE corpo=c;    

    DELETE FROM coinvolto
    WHERE id IN (SELECT ID
                 FROM supp);

    DELETE FROM analizzato
    WHERE evento IN (
                     SELECT ID
                 FROM supp);
END
$$
DELIMITER ;

