DELIMITER $$
CREATE TRIGGER `ControlloVotoI` BEFORE INSERT ON `giudica` FOR EACH ROW BEGIN
	IF NEW.voto < 1 THEN 
		SET NEW.voto = 1;
	ELSEIF NEW.voto > 5 THEN
		SET NEW.voto = 5;
	END IF;
END
$$
