DELIMITER $$
CREATE TRIGGER `ControlloVotoU` BEFORE UPDATE ON `giudica` FOR EACH ROW BEGIN
	IF NEW.voto < 1 OR NEW.voto > 5 THEN 
		SET NEW.voto = OLD.voto;
	END IF;
END
$$
DELIMITER ;

